import React from 'react'
import './index.less'
import {Card, Button, Icon, Form} from 'antd'
export default class Record extends React.Component {

    render(){
        return (
            <div class="container">
                <Card>
                    <HeaderForm />
                </Card>
            </div>
        );
    }
}
class HeaderForm extends React.Component{

    render(){
        return (
            <div>
                <span>Medical Record</span>
                <Button size={"large"}><Icon type="filter" /></Button>
                <Button size={"large"}><Icon type="reload" /></Button>
                <Button size={"large"}><Icon type="more" /></Button>
                <Button size={"large"}><Icon type="plus" />New Record</Button>
            </div>
        );
    }
}
HeaderForm = Form.create({})(HeaderForm);
